import React from 'react';
import Modal from '../Modal';
import history from '../../history';

class Jon extends React.Component{
  render(){
    return(
      <Modal
          title="Jon "
          content= ""
          onDismiss={() => history.push('/aboutus')}
      />
    );
  }
}

export default Jon;
